import Header from './componenets/Header'

const name = "Lee Quan Sheng"
const x = false

const App = () => {  
  return (
    <div className='container'>
      <Header />

      <h1>List Trackers</h1>
      <h2>Welcome {getAdmin(x)} </h2>
    </div>
  )
}

function getAdmin(x){
  return x ? "Quan Sheng" : "Jeya"
}

export default App;
